import { useState } from "react";
import { useGetRepoQuery } from "./api";

function SearchPage() {
    const [searchString, setSearchString] = useState('');

    const {data, isLoading} = useGetRepoQuery(searchString);

    return (
        <div>
            <input value={searchString} onChange={(e) => setSearchString(e.target.value)}></input>
            {isLoading ? (
                <div>Loading...</div>
            ) : (
                <ul>
                    {data.items.map((item: any) => (
                        <li key={item.id}>
                            <a href={`/repositories/${item.fullName}`}>{item.className}</a>
                        </li>
                    ))}
                </ul>
            )}
        </div>
    )
}

export default SearchPage;
